CREATE TABLE `categories` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `slug` varchar(255) DEFAULT NULL,
  `uuid` char(36) NOT NULL,
  `keywords` varchar(191) DEFAULT NULL,
  `parent_id` bigint NOT NULL DEFAULT '0',
  `type` tinyint NOT NULL DEFAULT '1',
  `img` varchar(255) DEFAULT NULL,
  `active` tinyint(1) NOT NULL DEFAULT '1',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  `input` smallint NOT NULL DEFAULT '32767',
  `status` varchar(255) NOT NULL DEFAULT 'pending',
  `shop_id` bigint unsigned DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `categories_uuid_index` (`uuid`),
  KEY `categories_parent_id_index` (`parent_id`),
  KEY `categories_shop_id_foreign` (`shop_id`),
  CONSTRAINT `categories_shop_id_foreign` FOREIGN KEY (`shop_id`) REFERENCES `shops` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=163 DEFAULT CHARSET=utf8mb3;

